import logo from './logo.svg'
import './App.css';

function App() {
  return(
    <div className='App'>
      <header className='App-header'>
        <img src={logo} className="App-logo" alt="logo" />
        <h1>Photo App</h1>
      </header>
      <form>
        <fieldset>
          <input name="image" type="file" accept='.jpeg, .png, .jpg'></input>
        </fieldset>
      </form>
    </div>
  );
}

export default App;
